import React from 'react';
import EmpData from './DashboardPage.json';
import './App.css';
function EmployeeList(props) {

    return (
        <div>
           <h1>Employee List</h1>
           {EmpData.map((empList, index) => {
               return <div className> 
               <h1>{empList.name}</h1>
               <h2>{empList.age}</h2>
               <p>{empList.gender}</p>
               <p>{empList.email}</p>
               <p>{empList.phoneNo}</p>
               </div>
           })}
     
        </div>
    )
}

export default EmployeeList
